('447', 'Soft Diet', 'Soft Diet', NULL, 18, 11, 'A normal diet limited to soft foods for those who have difficulty chewing or swallowing; no restrictions made on seasoning or method of food preparation.', '{160665000,41829006}', '{97802,97803}'),
('448', 'Two Gram Sodium Diet', 'Two Gram Sodium Diet', NULL, 18, 12, 'A 2 gram sodium diet limits high sodium foods in your diet. No table salt is allowed at meals or during cooking while you are on this diet. The amount of milk is also limited because of the amount of sodium it contains. A high amount of sodium in your diet can make your blood pressure go up and can cause other health problems. The goal of a 2 gram sodium diet is to prevent or lower high blood pressure. This diet can also keep your body from holding extra fluid. Problems with your liver and kidneys are another reason to follow this diet.', '{160665000,20676001,41829006,386619000}', '{97802,97803}'),
('449', 'Activity of Daily Living', 'Activity of Daily Living', NULL, 18, 13, 'The things we normally do in daily living including any daily activity we perform for self-care such as feeding ourselves, bathing, dressing, grooming, work, homemaking, and leisure.', '{41829006,2147483648,54500007}', '{NULL}'),
('450', 'As Tolerated', 'As Tolerated', NULL, 17, 14, 'Patient activities permitted as tolerated. Should the patient feel discomfort and/or pain, the activity should be ceased.', '{41829006,2147483648,54500007}', '{NULL}'),
('451', 'Bed Rest', 'Bed Rest', NULL, 20, 15, 'The restriction of a patient to bed for therapeutic reasons for a prescribed period.', '{41829006,2147483648,17535004,54500007}', '{NULL}'),
('452', 'Elevate Limb', 'Elevate Limb', NULL, 19, 16, 'The patient should elevate the limb for as long as is practically possible until advised.', '{41829006,2147483648,54500007}', '{NULL}'),
('453', 'No Bending or Stooping', 'No Bending or Stooping', NULL, 19, 17, 'The patient should refrain from bending and stooping until advised.', '{41829006,2147483648,54500007}', '{NULL}'),
('454', 'No Lifting', 'No Lifting', NULL, 19, 18, 'The patient should refrain from lifting until advised.', '{41829006,2147483648,54500007}', '{NULL}'),
('455', 'No Restrictions', 'No Restrictions', true, 16, 19, 'The patient has no activity restrictions', '{41829006,2147483648,54500007}', '{NULL}'),
('456', 'No Weight Bearing', 'No Weight Bearing', NULL, 19, 20, 'The patient should not put any weight on the affected part of the body until advised.', '{41829006,2147483648,54500007}', '{NULL}'),
('457', 'Evaluate and Treat', 'Evaluate and Treat', NULL, NULL, 21, 'The patient needs to see a physical therapist who can evaluate and treat the physical ailment.', '{138058003,147978009,277132007,41829006,2147483648,52052004}', '{NULL}'),
('458', 'None Needed', 'None Needed ', true, NULL, 22, 'No physical therapy is needed.', '{138058003,147978009,277132007,41829006}', '{NULL}'),
('459', 'Alcohol', 'Alcohol', NULL, NULL, 23, 'The patient should undergo alcohol cessation counseling.', '{11739001,409063005,41829006}', '{NULL}'),
('460', 'Counsel Patient', 'Counsel Patient', NULL, NULL, 24, 'The patient should undergo general counseling for their diagnosis and treatment plan.', '{10383002,11739001,171000001,171001002,171006007,171007003,171014001,171022008,171023003,243069004,310359007,311764000,313071005,313077009,313078004,313085000,313087008,315600006,316497002,33697008,409063005,409064004,41829006,2147483648,428997004,445061001,445142003,445563009,60112009,698505007,698506008,702583009,702595009,737375007,762449006,79841006,86515003}', '{99401,99402,99403,99404}'),
('461', 'None', 'None', true, 0, 0, 'None', '{160665000,41829006}', '{NULL}'),
('462', 'BRAT Diet', 'Bananas, Rice, Applesauce, Toast Diet', NULL, 17, 1, 'The BRAT diet consists of foods that are bland and gentle on the stomach. If you are feeling nauseous, queasy, or are vomiting, it may be hard to hold down food. Additionally, if you are experiencing diarrhea, this diet helps solidify stools ', '{41829006}', '{97802,97803}'),
('463', 'Clear Liquid Diet', 'Clear Liquid Diet', NULL, 19, 2, 'A clear liquid diet consists of clear liquids  such as water, broth and plain gelatin  that are easily digested and leave no undigested residue in your intestinal tract. ', '{41829006,2147483648,54500007}', '{97802,97803}'),
('464', 'Diabetic Diet', 'Diabetic Diet', NULL, 18, 3, 'A diabetes diet is a healthy-eating plan that''s naturally rich in nutrients and low in fat and calories. Key elements are fruits, vegetables and whole grains.', '{138058003,147978009,41829006}', '{97802,97803}'),
('465', 'High Fiber', 'High Fiber', NULL, 18, 4, 'A diet high in dietary fiber (typically more than 24 g daily), which decreases bowel transit time and relieves constipation.', '{11739001,41829006}', '{97802,97803}'),
('466', 'Ice Chips Diet', 'Ice Chips Diet', NULL, 19, 5, 'An ice chips diet is for a patient who is not able to eat for oral cleansing and satisfaction.', '{41829006}', '{97802,97803}'),
('467', 'Low Fat Diet', 'Low Fat Diet', NULL, 18, 6, 'A diet containing a minimal proportion of fat. Diets containing low amounts of fat and cholesterol are designed to reduce the risk of cardiovascular disease, specifically atherosclerosis. A low-fat diet should derive fewer than 10% of its calories from saturated fat (for example, meats, dairy products) and should be low in cholesterol (less than 300 mg/d) and trans fatty acids (for example, hydrogenated oils as in stick margarine and shortening) and rich in whole grains, fresh fruits and vegetables, and legumes. ', '{226109004,226111008,39545002,41829006,2147483648}', '{97802,97803}'),
('468', 'Low Purine', 'Low Purine', NULL, 18, 7, 'A diet for mitigation of gout, omitting meat, fowl, and fish and substituting milk, eggs, cheese, and vegetable protein.', '{22745007,41829006}', '{97802,97803}'),
('469', 'Normal Diet', 'Normal Diet', NULL, 16, 8, 'The patient has no dietary restrictions', '{41829006,41449007}', '{97802,97803}'),
('470', 'Nothing By Mouth', 'Nothing By Mouth', NULL, 20, 9, 'The patient is prohibited from ingesting food, beverage, or medicine as the digestive tract needs to be empty or the patient is unable to tolerate food and fluids by mouth for some reason.', '{182923009,41829006}', '{6020F}'),
('471', 'Renal Diet', 'Renal Diet', false, 18, 10, 'A diet prescribed in chronic renal failure and designed to control intake of protein, potassium, sodium, phosphorus, and fluids, depending on individual conditions. Carbohydrates and fats are the principal sources of energy. Protein is limited; the amount is determined by the patient''s condition and is usually supplied from milk, eggs, and meat. Cereals, bread, rice, and pasta are the primary sources of calories.', '{33489005,41829006}', '{97802,97803}'),
