('489', 'Apply Silvadene', 'Apply Silvadene', NULL, NULL, 42, 'Patient should apply silvadene (silver sulfadiazine), an antibiotic. It fights bacteria and fungus on the skin. Silver sulfadiazine topical (for the skin) is used to treat or prevent infections on areas of burned skin.', '{226109004,226111008,371400009,387112002,39545002,41829006,2147483648}', '{NULL}'),
('490', 'Change Dressing Daily', 'Change Dressing Daily', NULL, NULL, 43, 'Dressing over the wound needs to be changed daily.', '{226109004,226111008,39545002,41829006,2147483648}', '{97602}'),
('491', 'Dressing Changes as Directed', 'Dressing Changes as Directed', NULL, NULL, 44, 'Change dressings as directed by doctor.', '{226109004,226111008,39545002,41829006,2147483648}', '{NULL}'),
('492', 'Keep Clean and Dry', 'Keep Clean and Dry', NULL, NULL, 45, 'Keep wound clean and dry at all times.', '{226109004,226111008,39545002,41829006,2147483648}', '{97602}'),
('493', 'Not Needed', 'Wound Care Not Needed', true, NULL, 46, 'Wound Care Not Needed', '{11739001,41829006}', '{NULL}'),
('494', 'Remove Sutures Within 7 Days', 'Remove Sutures Within 7 Days', NULL, NULL, 47, 'Sutures need to be removed within seven days.', '{226109004,226111008,39545002,41829006,2147483648}', '{15850,15851}'),
('495', 'Wet to Dry Dressing', 'Wet to Dry Dressing', NULL, NULL, 48, 'By placing a wet (or moist) gauze dressing on your wound and allowing it to dry, wound drainage and dead tissue can be removed when you take off the old dressing.', '{2147483648,226109004,226111008,39545002,41829006}', '{97597,97598}'),
('496', 'Abdominal X-ray', 'Abdominal X-ray', NULL, NULL, 49, 'An abdominal x-ray is an imaging test to look at organs and structures in the abdomen. Organs include the spleen, stomach, and intestines.', '{22745007,41829006}', '{74000}'),
('497', 'Arm/Hand X-ray', 'Arm/Hand X-ray', NULL, NULL, 50, 'Imaging test of the arm/hand to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{73070,73080}'),
('498', 'Cervical Spine X-ray', 'Cervical Spine X-ray', NULL, NULL, 51, 'A cervical spine X-ray can help find the cause of symptoms such as neck, shoulder, upper back, or arm pain, as well as tingling, numbness, or weakness in the arm or hand. It can detect fractures in the cervical vertebrae or dislocation of the joints between the vertebrae.', '{22745007,41829006}', '{72126,72125,72127}'),
('499', 'Chest X-ray', 'Chest X-ray', NULL, NULL, 52, 'A chest X-ray is a picture of the chest that shows your heart, lungs, airway, blood vessels, and lymph nodes camera.gif. A chest X-ray also shows the bones of your spine and chest, including your breastbone camera.gif, your ribs, your collarbone camera.gif, and the upper part of your spine camera.gif. A chest X-ray is the most common imaging test or X-ray used to find problems inside the chest.', '{22745007,41829006}', '{7125,71260,71270}'),
('500', 'Echocardiagram', 'Echocardiagram', NULL, NULL, 53, 'An echocardiogram (also called an echo) is a type of ultrasound test that uses high-pitched sound waves that are sent through a device called a transducer. The device picks up echoes of the sound waves as they bounce off the different parts of your heart. These echoes are turned into moving pictures of your heart that can be seen on a video screen.', '{22745007,41829006,711507002}', '{76825}'),
('501', 'Elbow X-ray', 'Elbow X-ray', NULL, NULL, 54, 'Imaging test of the elbow to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{73070,73080}'),
('502', 'Facial bones', 'Facial bones', NULL, NULL, 55, 'Imaging test of the face to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{70490,70491,70492}'),
('503', 'Knee X-ray', 'Knee X-ray', NULL, NULL, 57, 'Imaging test of the knee to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{73564}'),
('504', 'Leg/foot X-ray', 'Leg/foot X-ray', NULL, NULL, 58, 'Imaging test of the leg/knee to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{73620}'),
('505', 'Lumbosacral Spine X-Ray', 'Lumbosacral Spine X-Ray', NULL, NULL, 59, 'Imaging test of the lower back to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{72129,72128,72130}'),
('506', 'Mammogram', 'Mammogram', NULL, NULL, 60, 'Imaging test of the breast to screen for cancers of the breast.', '{22745007,24623002,41829006}', '{76091}'),
('507', 'Nasal Bone', 'Nasal Bone', NULL, NULL, 61, 'Imaging test to screen for fractures of the nasal bone.', '{22745007,41829006}', '{70542,70540,70543}'),
('508', 'Not Needed', 'Imaging Not Needed', true, NULL, 62, 'Imaging Not Needed', '{11739001,41829006}', '{NULL}'),
('509', 'Pelvis/Hip X-ray', 'Pelvis/Hip X-ray', NULL, NULL, 64, 'Imaging test of the pelvis/hip to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{72195,72196,72197}'),
('510', 'Rib Series', 'Rib Series', NULL, NULL, 65, 'Imaging test of the rib to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{7125,71260,71270}'),
('511', 'Shoulder X-ray', 'Shoulder X-ray', NULL, NULL, 66, 'Imaging test of the shoulders to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{76499}'),
('512', 'Sinus Series', 'Sinus Series', NULL, NULL, 67, 'Imaging test to evaluate sinuses for disease process.', '{22745007,41829006}', '{70150}'),
('513', 'Skull X-ray', 'Skull X-ray', NULL, NULL, 68, 'Imaging test of the skull to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{70250,70260}'),
('514', 'Sonogram', 'Sonogram', NULL, NULL, 69, 'Imaging to evaluate organs for unspecified pathology.', '{22745007,41829006,709618003,709858003,710340004,711424006,711427004}', '{NULL}'),
('515', 'Thoracic X-ray', 'Thoracic X-ray', NULL, NULL, 70, 'Imaging test of the middle of the back to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{72072,72072,72074}'),
('516', 'X-ray', 'X-ray', NULL, NULL, 71, 'Imaging test to examine bones and soft tissue to determine if there is a fracture or soft tissue injury', '{22745007,41829006}', '{70010}'),
('517', 'Amylase', 'Amylase', NULL, NULL, 72, 'The blood amylase test is used to help diagnose and monitor acute pancreatitis. It may also be used to diagnose and monitor chronic pancreatitis and other disorders that may involve the pancreas. In certain cases, for example when there is an accumulation of fluid in the abdomen (ascites), an amylase test may be performed on peritoneal fluid to help make a diagnosis of pancreatitis. Amylase tests are sometimes used to monitor treatment of cancers involving the pancreas and after the removal of gallstones that have caused gallbladder attacks.', '{116534006,166570006,269929002,28378007,413057001,41829006,45516006,64435009,89659001,41449007}', '{82150}'),
('518', 'ANA', 'ANA (Antinuclear Antibody)', NULL, NULL, 73, 'The antinuclear antibody (ANA) test is used as a primary test to help evaluate a person for autoimmune disorders that affect many tissues and organs throughout the body.', '{359788000,41829006,41449007}', '{86225,86039}'),
('519', 'Blood Culture', 'Blood Culture', NULL, NULL, 74, 'Blood cultures are used to detect the presence of bacteria or fungi in the blood, to identify the type present, and to guide treatment. Testing is used to identify a blood infection (septicemia) that can lead to sepsis, a serious and life-threatening complication. Individuals with a suspected blood infection are often treated in intensive care units, so testing is often done in a hospital setting.', '{168333009,409611004,409612006,41829006,767383005,767385003,41449007}', '{87076}'),
('520', 'BMP', 'BMP (Basic Metabolic Panel)', NULL, NULL, 75, 'The basic metabolic panel (BMP) is used to check the status of a person''s kidneys and their electrolyte and acid/base balance, as well as their blood glucose level  all of which are related to a person''s metabolism. It can also be used to monitor hospitalized patients and people with certain known conditions, such as hypertension and hypokalemia.', '{41829006,41449007,767280006}', '{80048}'),
('521', 'BNP', 'BNP (B-type Natriuretic Peptide)', NULL, NULL, 76, 'A test for B-type natriuretic peptide (BNP) or N-terminal pro b-type natriuretic peptide (NT-proBNP) is primarily used to help detect, diagnose, and evaluate the severity of heart failure. It can be used, along with other cardiac biomarker tests, to detect heart stress and damage and/or along with lung function tests to distinguish between causes of shortness of breath. Chest X-rays and an ultrasound test called echocardiography may also be performed.', '{41829006,52642002,41449007}', '{83880}'),
('522', 'Cardiac Enzymes', 'CPK Isoenzymes Test', NULL, NULL, 77, 'The CPK isoenzymes test measures the different forms of creatine phosphokinase (CPK) in the blood. CPK is an enzyme found mainly in the heart, brain, and skeletal muscle.', '{14804005,397798009,41829006,41449007}', '{NULL}'),
('523', 'CBC', 'CBC (Complete Blood Count)', NULL, NULL, 78, 'The complete blood count (CBC) is often used as a broad screening test to determine an individual''s general health status. A CBC is a panel of tests that evaluates the three types of cells that circulate in the blood. A CBC includes the following: - Evaluation of white blood cells, the cells that are part of the body''s defense system against infections and cancer and also play a role in allergies and inflammation. - Evaluation of red blood cells, the cells that transport oxygen throughout the body. - Evaluation of platelets, cell fragments that are vital for normal blood clotting. It can be used to: - Screen for a wide range of conditions and diseases - Help diagnose various conditions, such as anemia, infection, inflammation, bleeding disorder or leukemia, to name just a few - Monitor the condition and/or effectiveness of treatment after a diagnosis is established - Monitor treatment that is known to affect blood cells, such as chemotherapy or radiation therapy', '{26604007,35774004,41829006,43789009,41449007}', '{85027}'),
('524', 'CMP', 'CMP (Comprehensive Metabolic Panel)', NULL, NULL, 79, 'The comprehensive metabolic panel (CMP) is used as a broad screening tool to evaluate organ function and check for conditions such as diabetes, liver disease, and kidney disease. The CMP may also be ordered to monitor known conditions, such as hypertension, and to monitor people taking specific medications for any kidney- or liver-related side effects. If a health practitioner is interested in following two or more individual CMP components, he or she may order the entire CMP because it offers more information.', '{41829006,41449007,767280006}', '{80053}'),
('525', 'CSF Analysis', 'Cerebrospinal Fluid (CSF) Analysis', NULL, NULL, 80, 'Cerebrospinal fluid (CSF) analysis is a group of laboratory tests that measure chemicals in the fluid that surrounds and protects the brain and spinal cord. The tests may look for proteins, sugar (glucose), and other substances.', '{41829006,41449007}', '{87077}'),
('526', 'D-Dimer', 'D-Dimer', NULL, NULL, 81, 'D-dimer tests are used to help rule out the presence of an inappropriate blood clot (thrombus). Some of the conditions that the D-dimer test is used to help rule out include Deep vein thrombosis (DVT), Pulmonary embolism (PE) and Stroke.', '{103826007,41829006,41449007}', '{85379}'),
('527', 'Anti-Double Stranded DNA', 'Anti-Double Stranded DNA', NULL, NULL, 82, 'The anti-double stranded DNA (anti-dsDNA) test is used to help diagnose lupus (systemic lupus erythematosus, SLE) in a person who has a positive result on a test for antinuclear antibody (ANA) and has clinical signs and symptoms that suggest lupus.', '{41829006,41449007}', '{86225}'),
('528', 'EKG', 'EKG (Electrocardiogram)', NULL, NULL, 83, 'An electrocardiogram is a test which measures the electrical activity of your heart to show whether or not it is working normally.', '{29303009,41829006,468701000,41449007}', '{93010}'),
('529', 'ESR', 'ESR (Erythrocyte Sedimentation Rate)', NULL, NULL, 84, 'The erythrocyte sedimentation rate is a test that has been used for many years to help detect inflammation associated with conditions such as infections, cancers, and autoimmune diseases. ESR is used to help diagnose certain specific inflammatory diseases, temporal arteritis, systemic vasculitis and polymyalgia rheumatica. This test may also be used to monitor disease activity and response to therapy in both of the above diseases as well as some others, such as systemic lupus erythematosus (SLE).', '{416838001,41829006,41898006,41449007}', '{85652}'),
('530', 'Estrogens', 'Estrogens', NULL, NULL, 85, 'Estrogen tests are used to detect a deficiency or excess in a woman and to help diagnose a variety of conditions associated with this imbalance. They may also be used to help determine the timing of a woman''s ovulation and may be ordered to monitor the health status of the developing baby and placenta during pregnancy. In a man, estrogen testing may be performed to detect a hormone excess and its cause.', '{41829006,88433003,41449007}', '{NULL}'),
('531', 'FOBT', 'FOBT (Fecal Occult Blood Test)', NULL, NULL, 86, 'A test for fecal occult blood looks for blood in your poop, or feces. It can be a sign of a problem in your digestive system, such as a growth, or polyp, or cancer in the colon or rectum.', '{270024004,41829006,41449007}', '{82270}'),
('532', 'Gonorrhea and Chlamydia DNA probe', 'Gonorrhea and Chlamydia DNA probe', NULL, NULL, 87, 'Test that is used to determine if a patient has gonorrhea or chlamydia.', '{41829006,41449007}', '{87491,87591}'),
('533', 'HBA1C', 'HBA1C (Hemoglobin A1C)', NULL, NULL, 88, 'The hemoglobin A1c test may be used to screen for and diagnose diabetes and prediabetes in adults. Hemoglobin A1c, also glycated hemoglobin or A1c, is formed in the blood when glucose attaches to hemoglobin. The higher the level of glucose in the blood, the more glycated hemoglobin is formed.', '{38082009,41829006,43396009,313995005,165666001,43920000,41449007}', '{83036}'),
('534', 'Hepatitis Panel', 'Hepatitis Virus Panel', NULL, NULL, 89, 'An acute viral hepatitis panel is used to help detect and/or diagnose acute liver infection and inflammation that is due to one of the three most common hepatitis viruses: hepatitis A virus (HAV), hepatitis B virus (HBV), or hepatitis C virus (HCV). There are several causes of hepatitis and the accompanying symptoms, so these tests are used to determine if symptoms are due to a current infection with a virus and to identify which virus in particular is causing the disease. These tests may also help determine if someone has been exposed to one of the viruses even before symptoms develop.', '{113032009,41829006,40093005,46325006,47758006,64411004,65911000,697001,79172007,90185007,41449007}', '{87522}'),
('535', 'HIV Screening', 'HIV (Human Immunodeficiency Virus) Screening', NULL, NULL, 90, 'HIV antibody and HIV antigen (p24) testing is used to screen for and diagnose HIV infections.', '{41829006,143221005,121201005,109179006,27494001,41449007}', '{80081}'),
('536', 'HLA-B27', 'HLA-B27 (Human Leukocyte Antigen B27)', NULL, NULL, 91, 'The HLA-B27 test is primarily ordered to help strengthen or confirm a suspected diagnosis of ankylosing spondylitis (AS). The HLA-B27 test is not diagnostic; that is, it is not a definitive test that can be used to diagnose or rule out a disorder. The result adds information and is one piece of evidence used along with the evaluation of signs, symptoms, and other laboratory tests to support or rule out the diagnosis of certain autoimmune disorders, such as ankylosing spondylitis and reactive arthritis.', '{166170003,41829006,52501007,41449007}', '{81374}'),
('537', 'Influenza Test', ' Influenza Rapid Antigen Test', NULL, NULL, 92, 'Influenza testing may be used to help diagnose an influenza infection (flu) and help make treatment decisions. Sometimes influenza testing is used to help document the presence of influenza in the community or to help determine whether an outbreak of flu is occurring, especially in settings such as nursing homes and schools. Testing may be used to identify the type and/or the strain of influenza causing infections', '{166170003,41829006,41449007}', '{87804}'),
('538', 'LFT', 'LFT (Liver Function Test/Hepatic Function Panel)', NULL, NULL, 93, 'A liver panel may be used to screen for liver damage, especially if someone has a condition or is taking a drug that may affect the liver. A liver panel or one or more of its component tests may be used to help diagnose liver disease if a person has signs and symptoms that indicate possible liver dysfunction. If a person has a known condition or liver disease, testing may be performed at intervals to monitor the health of the liver and to evaluate the effectiveness of any treatments. ', '{41829006,41449007}', '{80076}'),
('539', 'LH/FSH', 'LH/FSH (Lutenizing / Follicular Stimulating Hormone)', NULL, NULL, 94, 'To evaluate fertility issues, function of reproductive organs (ovaries or testicles), or pituitary function. A follicle-stimulating hormone test measures the amount of follicle-stimulating hormone (FSH) in a blood sample. FSH is produced by the pituitary gland. In women, FSH helps control the menstrual cycle and the production of eggs by the ovaries. The amount of FSH varies throughout a woman''s menstrual cycle and is highest just before she releases an egg (ovulates). In men, FSH helps control the production of sperm. The amount of FSH in men normally remains constant.', '{25217009,259348009,31003009,390778002,41829006,69527006,41449007}', '{80426}'),
('540', 'Lipase', 'Lipase', NULL, NULL, 95, 'The blood test for lipase is most often used, to help diagnose and monitor acute pancreatitis. It may also be used to diagnose and monitor chronic pancreatitis and other disorders that involve the pancreas but is not as useful of a test for these conditions because lipase levels remain elevated for longer periods and may not reveal clinical progress. Lipase testing is also occasionally used in the diagnosis and follow-up of cystic fibrosis, celiac disease, and Crohn disease.', '{116535007,271232007,41829006,72680000,104780002,41449007}', '{83690}'),
('541', 'Lipid Profile', 'Lipid Profile', NULL, NULL, 96, 'The lipid profile is used as part of a cardiac risk assessment to help determine an individual''s risk of heart disease and to help make decisions about what treatment may be best if there is borderline or high risk. Lipids are a group of fats and fat-like substances that are important constituents of cells and sources of energy. Monitoring and maintaining healthy levels of these lipids is important in staying healthy. The results of the lipid profile are considered along with other known risk factors of heart disease to develop a plan of treatment and follow-up. Depending on the results and other risk factors, treatment options may involve lifestyle changes such as diet and exercise or lipid-lowering medications such as statins.', '{16254007,41829006,41449007}', '{80061}'),
('542', 'Not Needed', 'Labs Not Needed', true, NULL, 97, 'Labs Not Needed', '{11739001,41829006}', '{NULL}'),
('543', 'PSA', 'PSA (Prostate Specific Antigen)', NULL, NULL, 98, 'The PSA test may be used to screen both asymptomatic and symptomatic men for prostate cancer. PSA is a protein produced primarily by cells in the prostate and most of the PSA is released into semen, but small amounts of it are also released into the blood. PSA exists in two forms in the blood: free (not bound) and complexed (cPSA, bound to other proteins). Lab tests can measure free PSA or total PSA (bound plus unbound).', '{41829006,443174008,63476009,706958000,395145001,395146000,41449007}', '{84153}'),
('544', 'PT/PTT/INR', 'PT/PTT/INR (Protime / Partial Thromboplastin Time / International Ratio)', NULL, NULL, 99, 'The prothrombin time (PT) is used, often along with a partial thromboplastin time (PTT), to help diagnose the cause of unexplained bleeding or inappropriate blood clots. The international normalized ratio (INR) is a calculation based on results of a PT and is used to monitor individuals who are being treated with the blood-thinning medication (anticoagulant) warfarin .', '{2147483648,41829006,7348004,41449007}', '{85049}'),
('545', 'Purified protein derivative', 'Purified Protein Derivative (TB Screening Tests)', NULL, NULL, 100, 'Tuberculosis (TB) screening tests are not used as general population screens but are used to screen people who are at high risk for TB exposure, such as: - People with diseases or conditions that weaken the immune system, such as HIV or AIDS, which makes them more vulnerable to a TB infection - Those who are in confined living conditions such as homeless shelters, migrant farm camps, nursing homes, schools, and correctional facilities - Healthcare workers and others whose occupations bring them in close contact with those who may have active TB - Those who have been in close contact with someone who has an active case of TB - People who have signs and symptoms consistent with active tuberculosis - Those who come from or have lived for a period of time in a foreign country where TB may be more common - Those who inject illegal drugs', '{300902008,41829006,41449007}', '{99211}'),
('546', 'Rapid Strep', 'Rapid Strep', NULL, NULL, 101, 'Strep tests are used to determine whether a person with a sore throat (pharyngitis) has strep throat, an infection of the throat and tonsils caused by the bacteria Streptococcus pyogenes, also called group A streptococcus (GAS).', '{41829006,41449007}', '{87081}'),
('547', 'Rheumatoid Factor', 'Rheumatoid Factor', NULL, NULL, 102, 'The rheumatoid factor (RF) test is primarily used to help diagnose rheumatoid arthritis (RA) and to help distinguish RA from other forms of arthritis or other conditions that cause similar symptoms.', '{41829006,54921001,41449007}', '{86431}'),
('548', 'Sputum Culture', 'Bacterial Sputum Culture', NULL, NULL, 103, 'A bacterial sputum culture is used to detect and diagnose bacterial lower respiratory tract infections such as bacterial pneumonia or bronchitis. I', '{104173009,41829006,45710003,41449007,61594008}', '{87181}'),
('549', 'Stool Culture', 'Stool Culture', NULL, NULL, 104, 'A stool culture is used to detect the presence of disease-causing (pathogenic) bacteria and help diagnose an infection of the digestive system (gastrointestinal, GI tract). Since there are many causes of GI infections, a stool culture may be used in conjunction with other tests, such as a GI pathogens panel or an ova and parasite exam (O&P) to help establish a diagnosis.', '{104191004,117028002,41829006,41449007}', '{87045,87081}'),
('550', 'Stool H-pylori', 'Stool H-pylori', NULL, NULL, 105, 'Helicobacter pylori testing is used to diagnose an infection due to the bacteria and to evaluate the effectiveness of treatment. H. pylori infection is associated with an increased risk of developing ulcers (peptic ulcer disease), chronic gastritis, and gastric (stomach) cancer.', '{123131000,41829006,317886002,41449007}', '{87338}'),
('551', 'Stool Ova & Parasites', 'Stool Ova & Parasites', NULL, NULL, 106, 'The ova and parasite (O&P) exam is used to detect the presence of parasites in a stool sample and help diagnose an infection of the digestive system (gastrointestinal, GI tract). Since there are many causes of GI infections, an O&P may be used in conjunction with other tests, such as a gastrointestinal (GI) pathogens panel or a stool culture, to help establish a diagnosis.', '{41829006,41449007}', '{87177}'),
('552', 'Synovial Fluid Analysis', 'Synovial Fluid Analysis', NULL, NULL, 107, 'Synovial fluid analysis may be ordered to help diagnose the cause of joint inflammation, pain, swelling, and fluid accumulation. ', '{41829006,85396007,41449007,365713007}', '{82945}'),
('553', 'Throat Culture', 'Throat Culture', NULL, NULL, 108, 'Taking a culture of the throat to evaluate bacterial growth.', '{117015009,41829006,41449007}', '{87077}'),
('554', 'Troponin', 'Cardiac-specific Troponin I and Troponin T', NULL, NULL, 109, 'Troponin tests are primarily ordered to help diagnose a heart attack and rule out other conditions with similar signs and symptoms. Either a troponin I or troponin T test can be performed; usually a laboratory will offer one test or the other. The concentrations are different, but they basically provide the same information.', '{102680009,105000003,121870001,166794009,313616005,41829006,102681008,102682001,102683006,41449007}', '{84484}'),
('555', 'TSH', 'TSH (Thyroid Stimulation Hormone/ Thyroid Peroxidase Antibody)', NULL, NULL, 110, 'Testing for thyroid antibodies, such as thyroid peroxidase antibody (TPO), is primarily ordered to help diagnose an autoimmune thyroid disease and to distinguish it from other forms of thyroid dysfunction. Thyroid autoantibodies develop when a person''s immune system mistakenly targets components of the thyroid gland or thyroid proteins, leading to chronic inflammation of the thyroid (thyroiditis), tissue damage, and/or disruption of thyroid function.', '{313440008,390778002,390780008,41829006,61167004,269845004,41449007}', '{84443}'),
('556', 'Uric Acid Level', 'Uric Acid Level', NULL, NULL, 111, 'The uric acid blood test is used to detect high levels of this compound in the blood in order to help diagnose gout. The test is also used to monitor uric acid levels in people undergoing chemotherapy or radiation treatment for cancer. Rapid cell turnover from such treatment can result in an increased uric acid level.The uric acid urine test is used to help diagnose the cause of recurrent kidney stones and to monitor people with gout for stone formation.', '{1710001,41829006,41449007}', '{84560}'),
('557', 'Urine Analysis', 'Urine Analysis', NULL, NULL, 112, 'Evaluate the urine for electrolytes and pH.', '{127800008,2278000,27171005,27260001,41829006,73392001,41449007}', '{81000}'),
('558', 'Urine Culture', 'Urine Culture', NULL, NULL, 113, 'The urine culture is used to diagnose a urinary tract infection (UTI) and to identify the bacteria or yeast causing the infection. It may be done in conjunction with susceptibility testing to determine which antibiotics will inhibit the growth of the microbe causing the infection. ', '{117011000,144795002,275885001,41829006,41449007}', '{87086,87088}'),
('559', 'Urine Drug Screen', 'Urine Drug Screen', NULL, NULL, 114, 'Drugs of abuse testing is used to screen for and confirm the presence of several drugs in a person''s sample, such as urine, blood or hair. Drug testing is used so that a person may receive appropriate medical treatment or be screened for or monitored for illegal drug use.', '{41829006,41449007,310627008}', '{80307}'),
('560', 'Urine Pregnancy', 'Urine Pregnancy', NULL, NULL, 115, 'Qualitative hCG testing detects the presence of hCG and is routinely used to screen for a pregnancy', '{144489004,144494004,41829006,109184000,41449007,356337002}', '{81025}'),
('561', 'Vaginal Culture', 'Vaginal Culture', NULL, NULL, 116, 'Taking a culture of the vagina to evaluate bacterial growth.', '{41829006,420401004,41449007}', '{87491,87591,87661,87798}'),
('562', 'VDRL', 'VDRL (Venereal Disease Research Laboratory)', NULL, NULL, 117, 'The venereal disease research laboratory (VDRL) test is designed to assess whether or not you have syphilis.', '{41829006,7786006,41449007}', '{86592}'),
('563', 'Viral Culture', 'Viral Culture', NULL, NULL, 118, 'Taking a culture to evaluate viral growth.', '{41829006,41449007}', '{87252}'),
('564', 'Wound Culture', 'Wound Culture', NULL, NULL, 119, 'Taking a culture of a wound to evaluate bacterial growth.', '{41829006,420401004,41449007}', '{87070}'),
('565', 'Arthrocentesis', 'Arthrocentesis', NULL, NULL, 120, 'A joint aspiration (arthrocentesis) is a test that involves withdrawing (aspirating) a small sample of joint fluid from a joint using a needle and syringe.', '{182923009,90131007}', '{20600}'),
('566', 'Audiometry', 'Audiometry', NULL, NULL, 121, 'An audiometry exam tests your ability to hear sounds. Sounds vary, based on their loudness (intensity) and the speed of sound wave vibrations (tone).', '{182923009,705316002}', '{92559}'),
('567', 'Cardiac Monitor', 'Cardiac Monitor', NULL, NULL, 122, 'An electronic monitor which, when connected to the patient, signals each heart beat with a flashing light, an electrocardiographic curve, an audible signal, or all three.', '{182923009}', '{93224,93225,93226,93227}'),
('568', 'Cold Compress', 'Cold Compress', NULL, NULL, 123, 'A pad of damp, thickly folded, soft absorbent cloth, dipped into cold water, wrung out, and applied to a body part for the relief of pain or reduction of inflammation or as a comfort measure.', '{150897000,182923009,277132007}', '{4267F}'),
('569', 'Compression stockings', 'Compression Stockings', NULL, NULL, 124, 'Compression stockings are a specialized hosiery designed to help prevent the occurrence of, and guard against further progression of, venous disorders1 such as edema, phlebitis and thrombosis. Compression stockings are elastic garments worn around the leg, compressing the limb. This reduces the diameter of distended veins and increases venous blood flow velocity and valve effectiveness. Compression therapy helps decrease venous pressure, prevents venous stasis and impairments of venous walls, and relieves heavy and aching legs.', '{182923009}', '{NULL}'),
('570', 'Debridement', 'Debridement', NULL, NULL, 125, 'Debridement is the process of removing non living tissue from pressure ulcers, burns, and other wounds.', '{150336002,182923009,235471009,237374004,239231007,239330006,242113002,312732009,312733004,312775003,36777000,446100009,447442008,450671005,46211007,67549005,69773006,726049001,85875009}', '{11000}'),
('571', 'Ear Lavage', 'Ear Lavage', NULL, NULL, 126, 'The washing out of the ear by copious injections and rejections of fluid.', '{182923009}', '{69209}'),
('572', 'Eye lavage', 'Eye lavage', NULL, NULL, 127, 'The washing out of the eye by copious injections and rejections of fluid.', '{182923009}', '{65205}'),
('573', 'I & D', 'I & D (Incision and Drainage)', NULL, NULL, 128, 'Incision and drainage is a minor surgical procedure to release pus or pressure built up under the skin, such as from an abscess, boil, or infected paranasal sinus. It is performed by treating the area with an antiseptic, such as iodine-based solution, and then making a small incision to puncture the skin using a sterile instrument such as a sharp needle, a pointed scalpel or a lancet. This allows the pus fluid to escape by draining out through the incision.', '{122462000,182923009,27651000,36525009,56783008}', '{10060}'),
('574', 'Immunization', 'Immunization', NULL, NULL, 129, 'Preventive medicine.', '{182923009,243789007,33879002,49083007,51572002}', '{90471}'),
('575', 'injection', 'Injection', NULL, NULL, 130, 'Injection of medication intended from treatment.', '{100390004,112948001,116670002,119586001,119603003,119629003,119630008,119650007,119651006,119669002,119785000,119882007,119971000,119986006,119990008,119997006,120041001,120103005,120163007,120170007,12320006,129326001,13357006,133875007,150862002,150870007,150871006,151038003,15415002,15872003,1636000,171790002,17679005,180190006,180246005,180260007,182923009,18428008,21879001,22293002,231063009,231274008,231276005,231281001,231353005,232558000,235495006,236366006,240283008,242049004,24456005,257866001,274497003,27581000,276908008,27705009,278213007,278214001,278216004,278217008,281706009,28289002,285435007,287983001,290035003,29519001,296778005,300024006,300034002,300035001,303611006,303614003,308752009,313191000,32090000,33810006,34333007,34511006,353660009,36511008,36673005,36843004,38696002,389905003,39074004,404909007,410563000,410569001,410573003,410574009,413147004,4143006,414503006,417617004,426734007,427015007,429241001,430046001,43066008,431864000,432861006,443255005,44500001,445433002,448884005,449356000,449673005,2147483648,52516005,53746003,54023001,5407000,58611004,61916001,66205002,68248001,68856007,70763004,708870005,709532005,709618003,7189005,722757009,72916004,74410004,745600007,745638006,79945003,80227005,8232000,84246003,85109004,90146000,90203006,90454009,258072000}', '{11900}'),
('576', 'IV Access', 'IV Access ', NULL, NULL, 131, 'A procedure to pierce a vein to allow for direct administration of medications and other treatments.', '{182923009}', '{36218}'),
('577', 'IV Hydration', 'IV Hydration', NULL, NULL, 132, 'Administration of fluids through an existing IV site.', '{182923009,78534001}', '{96360}'),
('578', 'Joint Injection', 'Joint Injection', NULL, NULL, 133, 'In medicine, a joint injection (intra-artPapanicolaouicular injection) is a procedure used in the treatment of inflammatory joint conditions, such as rheumatoid arthritis, psoriatic arthritis, gout, tendonitis, bursitis, Carpal Tunnel Syndrome, and occasionally osteoarthritis. A hypodermic needle is injected into the affected joint where it delivers a dose of any one of many anti-inflammatory agents, the most common of which are corticosteroids. Hyaluronic acid, because of its high viscosity, is sometimes used to replace bursa fluids. The technique may be used to also withdraw excess fluid from the joint.', '{129326001,182923009}', '{20610}'),
('579', 'Nail removal', 'Nail Removal', NULL, NULL, 134, 'Nails are removed only when necessary to allow the skin beneath the nail (the nail bed) to heal or in some cases, to remove a nail that has been partially pulled out in an accident. ', '{182923009,275090004}', '{11719}'),
('580', 'Nasal Impaction', 'Nasal Impaction', NULL, NULL, 135, 'Insertion of gauze to treat nasal bleeding.', '{182605004,182923009,287368003}', '{30903}'),
('581', 'Nebulizer', 'Nebulizer', NULL, NULL, 136, 'A device used to reduce a liquid medication to extremely fine cloudlike particles; useful in delivering medication to deeper parts of the respiratory tract.', '{150936005,182923009,277132007,708409001,170615005}', '{94640}'),
('582', 'Not Needed', 'Procedures Not Needed', NULL, NULL, 137, 'Procedures Not Needed', '{11739001,41829006}', '{NULL}'),
('583', 'Oxygen Therapy', 'Oxygen/Ozone Therapy', NULL, NULL, 138, 'Oxygen/ozone therapy is a term that describes a number of different practices in which oxygen, ozone, or hydrogen peroxide are administered via gas or water to kill disease microorganisms, improve cellular function, and promote the healing of damaged tissues. The rationale behind bio-oxidative therapies, as they are sometimes known, is the notion that as long as the body''s needs for antioxidants are met, the use of certain oxidative substances will stimulate the movement of oxygen atoms from the bloodstream to the cells. With higher levels of oxygen in the tissues, bacteria and viruses are killed along with defective tissue cells. The healthy cells survive and multiply more rapidly. The result is a stronger immune system.', '{150977009,182715001,182923009,24099007,243136002,243137006,277132007,304577004,410202008,426990007,707808001,20428008}', '{99183}'),
('584', 'Pap Smear', 'Pap Smear', NULL, NULL, 139, 'A Pap smear (Papanicolaou smear; also known as the Pap test) is a screening test for cervical cancer. The test itself involves collection of a sample of cells from a woman''s cervix (the end of the uterus that extends into the vagina) during a routine pelvic exam. The cells are placed on a glass slide and stained with a substance known as Papanicolaou stain. The stained cells are then examined under a microscope to look for pre-malignant (before-cancer) or malignant (cancer) changes.', '{182923009,386147002,448938001,90226004}', '{88160}'),
('585', 'Pulse Oximetry', 'Pulse Oximetry', NULL, NULL, 140, 'A measurement of the oxygen saturation of the blood.', '{182923009,394028004,448703006,462739001,706202002}', '{82805}'),
('586', 'Removal of foreign body', 'Removal of Foreign Body', NULL, NULL, 141, 'Removal of Foreign Body', '{128992008,150488008,150495004,172426003,182923009,235196003,53630002,9655003}', '{10120}'),
('587', 'Spinal Tap', 'Spinal Tap (Lumbar Puncture)', NULL, NULL, 142, 'A lumbar puncture (LP) is the insertion of a needle into the fluid within the spinal canal to collect and examine the fluid that surrounds the brain and spinal cord (cerebrospinal fluid). It is termed a lumbar puncture because the needle is placed in the lumbar portion of the back and used to puncture through tissues to enter the spinal canal.', '{182923009,277762005}', '{635}'),
('588', 'Spirometry', 'Spirometry', NULL, NULL, 143, 'A test of the air capacity of the lung. The test utilizes a machine called a spirometer to measure the volume of air inspired and expired by the lungs.', '{148471009,182923009,229301009,303501006}', '{94010}'),
('589', 'Splint/Cast', 'Splint/Cast', NULL, NULL, 144, 'Casts and splints are hard wraps used to support and protect injured bones, ligaments, tendons, and other tissues. They help broken bones heal by keeping the broken ends together and as straight as possible. Casts and splints also help with pain and swelling and protect the injured area from more harm.', '{182923009,261743002,69737004,430368000}', '{29125}'),
('590', 'Suture Removal', 'Suture Removal', NULL, NULL, 145, 'Removal of existing sutures.', '{182923009,289937003,466115003}', '{15850}'),
('591', 'Sutures', 'Sutures', NULL, NULL, 146, 'Sutures are tiny threads, wire, or other material used to sew body tissue and skin together. They may be placed deep in the tissue and/or superficially to close a wound. A variety of suture techniques are used to close a wound, and deciding on a specific technique depends on the location of the wound, thickness of the skin, degree of tensions, and desired cosmetic effect ', '{182923009,27065002,408099007}', '{12001}'),
('592', 'Vision Chart', 'Vision Chart', NULL, NULL, 147, 'A test to examine one''s visual acuity.', '{182923009}', '{99173}'),
('593', 'Wound irrigation', 'Wound irrigation', NULL, NULL, 148, 'Irrigation with saline to cleanse the wound.', '{182923009,225116006,67889009}', '{97602}'),
